import './styles.css';

function Quiz() {
  const [questions, setQuestions] = useState([]);

  useEffect(() => {
    setQuestions([
      {idItem:1,questionId:1, question:'Carreta 3 eixos trucado é conhecida como?', option: [{opt:1, name: '12 rolamento' },{opt:2, name: '06 rolamento' },{opt:3, name: 'Ana Maria (AM)' },{opt:4, name: '22 rolamento' },{opt:5, name: 'Asa Dura' }]},
      {idItem:1,questionId:2, question:'Que caminhoneiro você é? ',img: ImageQuiz2, realizado: false},
      {idItem:1,questionId:3, question:'O que te faz feliz? ',img: ImageQuiz3, realizado: false},
      {idItem:1,questionId:4, question:'Qual seu tipo de familia? ',img: ImageQuiz4, realizado: true},]);
  },[]);

  return ( 
    <>
    <NavigationBar/>

    <Container > 
     <Row>
      <Col>
      </Col>
     </Row>
    </Container>   

    </>
  );
}

export default Quiz;
